import styled from "styled-components";

const FooterContainer = styled.div`
  display: flex;
  justify-content: flex-end;
`;

const FooterContact = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
`;

function Footer() {
  return (
    <FooterContainer>
      <span>Social media</span>
      <span>I</span>
      <span>Y</span>
    </FooterContainer>
  );
}

export default Footer;
